import React from "react";
import { iconlookup } from "./constants.js";
const Icon = ({ title, createPanel }) => {
  const ispanel = iconlookup[title]["ispanel"]; //display panel or link to html an anonymous function just because
  const returnHTML = iconlookup[title]["returnHTML"];
  return (
    <div
      onClick={(event) =>
        ispanel ? createPanel(title, returnHTML) : returnHTML
      }
      className="icon"
    >
      <a className="icon-anchor" href="/#">
        <img
          className="icon-img"
          src={require("./assets/image.png")}
          alt="123"
        />
        <span className="icon-name">{title}</span>
      </a>
    </div>
  );
};

export default Icon;
